// urlToImage: "https://a1.espncdn.com/combiner/i?img=%
        const tempHeadlineList = this.getHeadline()

        const headLineItems = tempHeadlineList && tempHeadlineList.articles.map(news => {
            return (
            <div class="media">
                <a href={news.url} ><img src={news.urlToImage} class="mr-3" alt="..." /></a>
                <div class="media-body">
                    <h5 class="mt-0">news.content</h5>)
                    {news.author}
                </div>
            </div>
        )})

        return (
            <div>
                
            </div>
        );
    }
}

export default NewsHeadLineBox;
